import React, { useState, useEffect } from "react";

function StatesCapitals() {
  const [capitals, setCapitals] = useState([]);

  useEffect(() => {
    fetch("db.json")
      .then((response) => response.json())
      .then((data) => setCapitals(data))
      .catch((error) => console.log(error));
  }, []);

  return (
    <div>
      <h1>US State Capitals</h1>
      <table>
        <thead>
          <tr>
            <th>State</th>
            <th>Capital</th>
          </tr>
        </thead>
        <tbody>
          {capitals.map((state) => (
            <tr key={state.id}>
              <td>{state.name}</td>
              <td>{state.capital}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default StatesCapitals;
